import React from "react";
import "./Header.css";

function Home() {
  return (
    <div className="logo">
       <img src="/images/logo-social.png" width="160px" height="100px"></img>
       <div className="Title">
          <h1>Picturist</h1>
        </div>
    </div>
  )
}

export default Home;
